import React from "react";
import { Index, Table, TableProps } from "react-virtualized";
import { ILogmessage } from "./interfaces/ILogmessage";
import LoggingTableColunm from "./loggingTableColunm";
import 'react-virtualized/styles.css'

interface IProps extends TableProps{
    logmessages: ILogmessage[]
}

const LogTable: React.FC<IProps> = (props) =>{
    const {logmessages} = props

    const rowGetter = React.useCallback((info: Index) =>{
        return logmessages[info.index]
    },[logmessages])

    return(
        <Table rowGetter={rowGetter} noRowsRenderer={() => (<div></div>)} {...props}>
            {LoggingTableColunm({dataKey: "id", width: 50})}
            {LoggingTableColunm({dataKey: "type", width: 200})}
            {LoggingTableColunm({dataKey: "message", width: 400})}
        </Table>
    )
} 

export default LogTable
